import { joinPaths } from "@remix-run/router";
import React from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import { HomePage } from "./pages";

const App = () => {
    return(
        <BrowserRouter>
            <Routes>
                <Route path = "/" element = {<HomePage/>}/>
            </Routes>
        </BrowserRouter>
    )
}

export default App;
